    render() { 

        const { data, columns } = this.props;

        return ( 
            <tbody>
                {data.map(item =>(    
                    <tr>
                        {columns.map(column =>(
                            <td>
                               {_.get(item, column)}     
                            </td> 
                        ))}   
                    </tr>
                ))}

            </tbody>
        );
    }
}

export default TableBody;
